import styles from "./Superpowers.module.css";

export function AlohomoraPower({
  isAvailable,
  //   onClick,
  onMouseEnter,
  onMouseLeave,
  setIsAlohomoraMouseEnter,
  isEpiphanyMouseEnter,
  isEpiphanyAvailable,
}) {
  return isAvailable ? (
    <div
      //   onClick={onClick}
      className={isEpiphanyMouseEnter && isEpiphanyAvailable ? styles.hidden : styles.superpowerContainer}
      onMouseEnter={() => onMouseEnter({ setIsAlohomoraMouseEnter })}
      onMouseLeave={() => onMouseLeave({ setIsAlohomoraMouseEnter })}
    >
      <img className={styles.superpowerIcon} src="../power-alohomora.svg" alt="Суперсила алохомора" />
    </div>
  ) : (
    ""
  );
}
